    cursos.forEach((element) => {
      total += element.cantidad;
    });

    console.log(cursos);
  };

  calcularTotal();

  return (
    <div className="cantidad">
      <p className="cantidad__p">0</p>
    </div>
  );
};

export default Cantidad;
